import React from 'react';
import LogoAJA from './../../../assets/logoaja.png'


const Footer = () => {
    return (
        <footer style={{display: 'flex', flexDirection: 'row', justifyContent:'center', alignItems: 'center', backgroundColor: '#434343', paddingVertical: 20}}>
            <img src={LogoAJA} alt="logo da AJA" />
        </footer>
    );
}

export default Footer;
